import React from 'react'
import '../../App.css'
import '../HeroSection.css';
import sample from './video-3.mp4';

export default function Tickets() {
    return (

        <div>
            <video className='videoTag' autoPlay loop >
                <source src={sample} type='video/mp4' />


            </video>

        </div>
    )
}
